aphi=0; bphi=pi;
[pointt,wt]=lgwt(N,atheta,btheta); 
[pointp,wp]=lgwt(N,aphi,bphi);
[phi1,theta1]=meshgrid(pointp,pointt);
s = sigmad1(phi1,theta1,g1(1,1),g1(1,2),g1(1,3),g1(2,1),g1(2,2),g1(2,3),g1(3,1),g1(3,2),g1(3,3));
% s=2*ones(size(phi1)); %To compute isotropic kernel


%%

K=zeros(n1,n2,n3);
%%

fin=find(Jg ~=0);
fin=(fin/N/N)+1;
fin=fix(fin);
fin=unique(fin);

[x1,y1,z1] = ind2sub(dims,fin);

%Numericl integration
for x_length=1:length(x1)
    m=x1(x_length);
    n=y1(x_length);
    p=z1(x_length);

    a=zeros(N,N);
    d=N*N*(m-1)+N*N*n1*(n-1)+N*N*n1*n2*(p-1);
    a_unroll=Jg(d+1:d+N*N,1);
    a=reshape(a_unroll,[N,N]);

    F=a'.*s';
    sumphi=wp'*F;
    K(m,n,p)=sumphi*wt;
end 

%%
K=K.*(K>0);
Ker=real(fftn(ifftshift(K/dt^1.5))/n1/n2/n3);
mmax=max(max(max(Ker)));
    mmin=min(min(min(Ker)));
    fprintf('For grain %d, maximum of fftkernel is %d and the minimum is %d. \n',i,mmax,mmin)
    fname = sprintf('fftK%d.mat', i);
    MyFile=strcat(MyDir2,fname);
    save(MyFile,'Ker','-v7.3');
end